      <Files />
      <Layout>
        <p>Home (/)</p>
      </Layout>
      <style jsx>{`
      .guc {
        height: 93%;
        width: 93%;
        margin: 0 auto;
      }
      .layout {
        margin: 20,
        padding: 20
      }
    `}</style>
    </div>
  );
}
